import React, { useState, useEffect } from 'react';
import axios from 'axios';

const SolvedComplaints = () => {
  const [complaints, setComplaints] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('http://localhost:5000/complaints/solved').then((response) => {
      setComplaints(response.data.complaints);
      setLoading(false);
    });
  }, [complaints]);

  return (
    <div>
      <h2>Çözümlenmiş Arızalar</h2>
      {loading ? (
        <p>Veritabanından gelen verileri yükleniyor...</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Arıza No</th>
              <th>Başlık</th>
              <th>Kaydı Oluşturan Kullanıcı</th>
              <th>Statü</th>
              <th>Detayları Gör</th>
            </tr>
          </thead>
          <tbody>
            {complaints.map((complaint) => (
              <tr key={complaint.id}>
                <td>{complaint.id}</td>
                <td>{complaint.title}</td>
                <td>{complaint.created_by}</td>
                <td>{complaint.status}</td>
                <td>{/* Detayları gör butonu ve modal açmak için işlemler */}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
  
};

export default SolvedComplaints;
